function [l1,l2,k] = solver_test(x1,xp1,x2,xp2,x3,xp3)

data = [x1;xp1;x2;xp2;x3;xp3];

C = setup_elimination_template(data);
C0 = C(:,1:63);
C1 = C(:,64:end);
b_ind = [61,125,189];
b = zeros(63,3);
b(b_ind) = -1;
alpha = C0' \ b;
RR = [alpha'*C1;eye(2)];
AM_ind = [1,2];
AM = RR(AM_ind,:);
[V,D] = eig(AM);
V = V ./ (ones(size(V,1),1)*V(1,:));
sols(1,:) = diag(D).';
sols(2,:) = RR(3,:)*V;
sols(3,:) = V(2,:);

l1 = sols(1,:);
l2 = sols(2,:);
k = sols(3,:);

